import React, { Component } from "react";
import { Drawer, Button, Icon } from "flwww";

class Dashboard extends Component {
  state = {
    drawerIsVisible: false
  }

  toggleDrawer = () => {
    this.setState(prevState => ({ drawerIsVisible: !prevState.drawerIsVisible }))
  }

  render(){
    return (
      <div>
        <div>
          <Button type="primary" onClick={ this.toggleDrawer } outlined>
            <Icon type="menu" />
            <span>Menu</span>
          </Button>
        </div>

        <Drawer
          showDrawer={ this.state.drawerIsVisible }
          toggleDrawer={ this.toggleDrawer }>
          <h3>Register business</h3>
          <h3>Update business</h3>
          <h3>View business</h3>
          <h3>Logout</h3>
        </Drawer>
      </div>
    )
  }
}

export default Dashboard;
